import logo from './logo.svg';
import './App.css';

function App() {

  let matrixObject = []

  for (let i = 0; i < 8; i++) {
    matrixObject.push([])
    for (let k = 0; k < 8; k++) {
      matrixObject[i].push(k)
    }
  }


  // matrixObject.forEach(e => console.log(e))

  matrixObject.map(e => console.log(e))


  return (
    <div className="App">
      <header className="App-header">
        {matrixObject.map(e =>
          <div>{e}</div>
        )}
      </header>
    </div>
  );
}

export default App;
